ads.description:
Dzień dobrym, mam do sprzedania samochód osobowy marki Peugeot 206 wyprodukowany w 2006 roku, który został wyposażony w silnik benzynowy, doposażony w instalacje LPG (butla ważna do 2030 roku) o pojemności 1360 cm3, legitymujący się mocą 75 KM, który pokonał do tej pory 197000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Peugeot prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane.



206 jest wyposażenia w:

- Klimatyzacje;

- Elektryczne szyby przednie;

- ABS;

- Centralny zamek;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 26.02.2026 roku.

Przegląd techniczny 02.11.2025 roku.
